import React, { useState } from 'react'
import ReactDOM from 'react-dom'



const Display = props => <h1>{props.value}</h1>

const Button = (props) => (
  <button onClick={props.handleClick}>
    {props.text}
  </button>

)

const Content =(props)=>(
<div>{props.name} {props.total}</div>
)

const Total = (props)=>{

  let full 
  <div>all: {full=(props.good + props.neutral + props.bad)}</div>
  return(
    console.log(full)
  )
  }


const App = () => {
  // save clicks of each button to its own state

  const [good, setGood] = useState(0)
  const [neutral, setNeutral] = useState(0)
  const [bad, setBad] = useState(0)

  return (
    <div>
      <Display value={"give feedback"}></Display>
      <Button handleClick={() => setGood(good + 1)} text="Good" />
      <Button handleClick={() => setNeutral(neutral + 1)} text="Neutral" />
      <Button handleClick={() => setBad(bad + 1)} text="Bad" />
      <Display value={"statics"}></Display>
      <Content name={"good:"}total={good}></Content>
      <Content name={"neutral:"}total={neutral}></Content>
      <Content name={"bad:"}total={bad}></Content>
      <Total good={good} neutral={neutral} bad={bad}></Total>

    </div>
  )
}

ReactDOM.render(<App />, 
  document.getElementById('root')
)
